import React from 'react';
import '../index.css'; // Импорт вашего CSS файла
import team1 from '../assets/team1.png';
import team2 from '../assets/team2.png';
import yergen from '../assets/yergen.jpg';
function Teams() {
  return (
    <div className="row-img" id='locations'>
      <div className="withtext">
        <div className="circular_image">
          <img src="../assets/team1.png" alt="Team Member 1" />
        </div>
        <h1>SILVESTER</h1>
        <p>МАРКЕТОЛОГ</p>
      </div>

      <div className="withtext">
        <div className="circular_image">
          <img src={team1} alt="Team Member 2" />
        </div>
        <h1>SILVESTER</h1>
        <p>МАРКЕТОЛОГ</p>
      </div>

      <div className="withtext">
        <div className="circular_image">
          <img src="../assets/yergen.jpg" alt="Team Member 3" />
        </div>
        <h1>SILVESTER</h1>
        <p>МАРКЕТОЛОГ</p>
      </div>
    </div>
  );
}

export default Teams;
